import React from 'react';
import './App.css';
import Nav from './Nav';
import About from './About';
import Signin from './Signin';
import Signup from './Signup';


function App() {
  return (
    <div className="App">
      <Nav />
      <About />
      <Signin />
      <Signup />
    </div>
  );
}

export default App;
